import React, {useEffect, useState} from 'react'
import { useParams } from 'react-router-dom';

const QueenInfo = () => {
    const params = useParams();
    const [queen, setQueen] = useState(null);

    useEffect(() => {
        fetch(`http://localhost:9000/queens/${params.queenid}`, {method: 'GET'})
        .then(res => res.json()
        .then(queen => console.log(queen))
        );
    })

    return (
        <div>
            <p>{params.queenid}</p>
        </div>
    )
}

export default QueenInfo
